package FirstPackage;

public class Multiplication_1To5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//Sireesha_Boddu
		int i,j;
		for(i=1;i<=5;i++) {
			for (j=1;j<=10;j++) {
				int result=i*j;
				System.out.println(i + " x " + j + " = " + result);
			}
			System.out.println();
		}
	}
}
